import axios from 'axios';
import { useState, useEffect } from 'react';
import { useParams } from 'react-router';
import Boton1 from './Boton1';
import React, { Component } from "react";
import { Navigate } from "react-router-dom";
import AuthService from "../services/auth.service";

export const SERVER_URL = "http://localhost:8080"

export default class ElegirModelo extends Component {
    constructor(props) {
      super(props);

      this.state = {
        redirect: null,
        userReady: false,
        currentUser: { username: "" }
      };
    }

    componentDidMount() {
      const currentUser = AuthService.getCurrentUser();

      if (!currentUser) this.setState({ redirect: "/home" });
      this.setState({ currentUser: currentUser, userReady: true })
    }

    render() {
      if (this.state.redirect) {
        return <Navigate to={this.state.redirect} />
      }

    const { currentModelos } = "";

    const Modelos = async () => {
        await axios.get("${SERVER_URL}/api/auth/elegir-modelo)")
            .then(response => {
                console.log(response.data);
                currentModelos = response.data;
            })
            .catch(error => {
                console.log(error);
            });
    };


    return (
        <div className="card_3">
            <label for="standard-select">Elige un modelo:</label>
           <div class="select">
                <select id="standard-select" placeholder={"Selecciona un modelo..."}>
                    <option value="" disabled selected>Selecciona un modelo...</option>
                    {currentModelos.map((modelos) => (
                        <option value={modelos.id}>{modelos.nombre}</option>
                    ))}
                </select>
            </div>
        </div>
    );
}
}
